import './App.css';
import CodeBlock from "./CodeBlock";

const textToRender = "Hello, world!";

function Header() {
  return (
    <header className="header">
      <h1>Header</h1>
    </header>
  );
}

function Content() {
    let x = <p>This is the main content of the page.</p>;
    let y = <p>This is the main content of the page.</p>;
    for (let i = 0; i< 50; ++i) {
        x = x + y;
    }

  return (
    <div className="content">
      <h2>Main Content</h2>
      <CodeBlock text={textToRender}/>
        {x}
      <p>This is the main content of the page.</p>
    </div>
  );
}

function Footer() {
  return (
    <footer className="footer">
      <p>Footer</p>
    </footer>
  );
}

function App() {
  return (
    <div className="app">
      <Header />
      <Content />
      <Footer />
    </div>
  );
}


export default App;
